import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    const name = "Lyzmar";
    return (
      <div>
        <h1>Aprendiendo React</h1>        
        <span>Hola {name}</span>
      </div>
    );
  }
}

export default App;
